import React from 'react';
import PatientItem from './PatientItem';
import './PatientList.css';

const PatientList = () => {
  const patients = [
    { name: '정재욱', id: '#XOEIF5GJ', image: '/path/to/image1.jpg' },
    { name: '여은동', id: '#EXFQ921K', image: '/path/to/image2.jpg' },
    { name: '현뚱따', id: '#MAPLEII16', image: '/path/to/image3.jpg' },
    { name: '정진우', id: '#DARKYETI', image: '/path/to/image4.jpg' }
  ];

  return (
    <div className="patient-list">
      {patients.map((patient, index) => (
        <PatientItem key={index} patient={patient} />
      ))}
    </div>
  );
};

export default PatientList;
